scriptlet.script:
// exception=wrongname.swinfra.net can't be found
try {
	var response = scriptletContext.get("RS_Previous_Response");
	var re = /^(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)$/;
	var message = hostname + " can't be found";

	if(response === "failure" && exception === message) {
		var i = parseInt(iteration);
		if(i<=max) {
			i++;
			scriptletContext.put("iteration",i);
			scriptletResponse="sleep";
		}
		else {
			throw new Error("DNS Lookup Timeout. " + message);
		}
	}
	else if(response === "success" && re.exec(ipaddress) != null) {
		scriptletResponse="continue";
	}
	else {
		throw new Error("DNS Lookup Internal Failure");
	}
}
catch(error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage",error);
}
